let moviesList = ['Chaava', 'Pushpa 2', 'Baby John', 'KGF - 2', 'Bahubali 2'];
let slots = ['10:00 AM', '01:00 PM', '03:00 PM', "08:00 PM"];
let seats = ['A1', 'A2', 'A3', 'A4', 'D1', 'D2'];
let movieImages = {
    'Chaava': './assets/images/chaava.jpeg',
    'Pushpa 2': './assets/images/pushpa2.jpeg',
    'Baby John': './assets/images/babyjohn.jpeg',
    'KGF - 2': './assets/images/kgf2.jpeg',
    'Bahubali 2': './assets/images/bahubali2.jpeg'
  };
exports.moviesList = moviesList;
exports.movieImages = movieImages;
exports.slots = slots;
exports.seats = seats;
